import styled from 'styled-components'
import { Link } from 'react-router-dom'

const StyledHeader = styled.header`
    display: flex;
    align-items: center;
`;

const Button = styled.button`
    width: 6em;
    height: 70%;
    margin: 1em;
`;

const Title = styled.h2`
    margin-left: 0;
`;

const Header = () => {
    return (
        <StyledHeader>
            <Link to='/menu'><Button>Menu Icon</Button></Link>
            <Title>WMS Management</Title>
            <h3 style={{marginLeft: 'auto', marginRight: '1em'}}>USER</h3>
        </StyledHeader>
    )
}

export default Header
